     console.log(current);
  })

  const pages = [
    {route: '/shop', name: 'shop'},
    {route: '/collections', name: 'collections'},
    {route: '/shopInsta', name: 'shop insta'},
    {route: '/blog', name: 'blog'},
    {route: '/contact', name: 'contact'},
    {route: '/', name: 'home'},
  ]


  return (
    <div className="side-nav">
